import { data } from 'jquery';
import React, { Component } from 'react'

class Track extends React.Component
{
    render() {
        alert(JSON.stringify(this.props.data));
        return (
            <div>{ this.props.data == null ? "X" : this.props.data.id }</div>
        )
    }
}

export default Track;
